import React from 'react';
import { Route } from 'react-router-dom';
import { TicTacToe } from '../TicTacToe';
import { GoodsShow } from '../GoodsShow';


export class Home extends React.Component {
    tictactoeClick() {
        <Route path='/TicTacToe' exact component={TicTacToe}></Route>
    }
    goodsshowClick() {
        <Route path='/GoodsShow' exact component={GoodsShow}></Route>
    }
    render() {
        return (
            <div>
                <button onClick={() => this.tictactoeClick()}>TicTacToe</button>
                <button onClick={() => this.goodsshowClick()}>GoodsShow</button>
            </div>
        );
    }
}
